// import axios from "axios";
import React, { useEffect} from "react";
import { useDispatch, useSelector } from "react-redux";
import EmptyStripe from "./EmptyStripe";
import LoadingBox from "./LoadingBox";
import MessageBox from "./MessageBox";
import Shoe from "./Shoe";
import { listShoe } from '../actions/shoeAction';
export default function Shoes() {
  // const [productShoes, setproductShoes] = useState([]);
  // const [loading, setLoading] = useState(false);
  // const [error, setError] = useState(false);
  const dispatch = useDispatch();
  const shoeList = useSelector( (state) => state.shoeList);
  const {loading, error, productShoes } = shoeList;

  useEffect(() => {
   dispatch(listShoe());
    // const fetchData = async () => {
    //   try {
    //     setLoading(true);
    //     const { data } = await axios.get("/api/productShoes");
    //     setLoading(false);
    //     setproductShoes(data);
    //   } catch (err) {
    //     setError(err.message);
    //     setLoading(false);
    //   }
    // };
    // fetchData();
  }, [dispatch]);
  return (
    <div>
      <EmptyStripe />
      <section class="category" id="category">
        <div class="max-width">
          {loading ? (
            <LoadingBox></LoadingBox>
          ) : error ? (
            <MessageBox variant="error">{error}</MessageBox>
          ) : (
            <div class="category-content">
              {productShoes.map((productShoe) => (
                <Shoe key={productShoe._id} productShoe={productShoe}></Shoe>
              ))}
            </div>
          )}
        </div>
      </section>
    </div>
  );
}
